import VideoMp4 from 'Big_Buck_Bunny_1080_10s_5MB.mp4';

const Home = () => {
  return (
    <div className="App">
      <header className="App-header">

                <video className="video-web" autoPlay muted loop playsInline>
                  <source src={VideoMp4} type="video/mp4" />
                </video>


      </header>
    </div>
  );
}

export default Home;
